INSERT INTO `v1_2b244061bab12d1a43f3eef476215d0375d7c12e067e0996c8d6fbfa766ba43d` VALUES (3, "逆境に屈することなく、部員たちを引っ張る主将。ミート力を活かした安定感のある打撃が持ち味。", 1, 0, 2, "---", "", "アサヒ", 1, 6000);
INSERT INTO `v1_2b244061bab12d1a43f3eef476215d0375d7c12e067e0996c8d6fbfa766ba43d` VALUES (0, "無愛想だが仲間を大切に想う気持ちは誰よりも強い男。ケンカで鍛えた腕っぷしが自慢のパワーヒッター。", 3, 3, 3, "アドレナリン", "ホームランを連発すると、連発数に応じてパワーアップする", "部員3", 1, 16000);
INSERT INTO `v1_2b244061bab12d1a43f3eef476215d0375d7c12e067e0996c8d6fbfa766ba43d` VALUES (2, "みんなからの厚い信頼を集める期待の助っ人部員。実力は未知数だが幸運なハプニングを呼び込む。", 2, 2, 4, "ラッキー", "幸運のハプニングを呼び込む", "{0}", 1, 30000);
INSERT INTO `v1_2b244061bab12d1a43f3eef476215d0375d7c12e067e0996c8d6fbfa766ba43d` VALUES (1, "みんなの知らない極秘情報がのっているおまけページ。決して誰かに見せてはいけない。", 0, 1, 5, "", "", "選手名鑑 おまけページ", 0, 50000);
